import{showPage}from"../../../../../../scripts/src/loadPage.min.js";import{VectorField}from"/applets/vector-fields/scripts/class.min.js";import{createDesmosGraphs,desmosPurple,setGetDesmosData}from"/scripts/src/desmos.min.js";import{$}from"/scripts/src/main.min.js";function load(){setGetDesmosData(()=>{return{"vector-field":{bounds:{left:-10,right:10,bottom:-10,top:10},expressions:[{latex:String.raw`f(x_1, x_2) = [ x_1 + x_2, -2x_1 + 3x_2 ]`},{latex:String.raw`F(x_1, x_2) = \frac{1}{2.5} f(x_1, x_2)`,secret:!0},{latex:String.raw`z = -2.86`,secret:!0},{latex:String.raw`k = .33`,secret:!0},{latex:String.raw`A(t) = \floor(t) - 10\floor(\frac{t}{10})`,hidden:!0,secret:!0},{latex:String.raw`B(t) = \floor(\frac{t}{10})`,hidden:!0,secret:!0},{latex:String.raw`M(x, y) = \frac{1}{\sqrt{(F(x, y)[1])^2 + (F(x, y)[2])^2}}`,hidden:!0,secret:!0},{latex:String.raw`R_1(x, y) = M(x, y)(F(x, y)[1]\cos(z) - F(x, y)[2]\sin(z))`,hidden:!0,secret:!0},{latex:String.raw`L_1(x, y) = M(x, y)(F(x, y)[1]\cos(z) + F(x, y)[2]\sin(z))`,hidden:!0,secret:!0},{latex:String.raw`R_2(x, y) = M(x, y)(F(x, y)[1]\sin(z) + F(x, y)[2]\cos(z))`,hidden:!0,secret:!0},{latex:String.raw`L_2(x, y) = M(x, y)(-F(x, y)[1]\sin(z) + F(x, y)[2]\cos(z))`,hidden:!0,secret:!0},{latex:String.raw`(A(t) - 10 + .1(t - \floor(t))F(A(t) - 10, B(t))[1], B(t) + .1(t - \floor(t))F(A(t) - 10, B(t))[2])`,color:desmosPurple,parametricDomain:{min:-100,max:100},secret:!0},{latex:String.raw`(A(t) + .1(t - \floor(t))F(A(t), B(t))[1], B(t) + .1(t - \floor(t))F(A(t), B(t))[2])`,color:desmosPurple,parametricDomain:{min:-100,max:100},secret:!0},{latex:String.raw`(A(t) - 10 + .1F(A(t) - 10, B(t))[1] + k(t - \floor(t))R_1(A(t) - 10, B(t)), B(t) + .1F(A(t) - 10, B(t))[2] + k(t - \floor(t))R_2(A(t) - 10, B(t)))`,color:desmosPurple,parametricDomain:{min:-100,max:100},secret:!0},{latex:String.raw`(A(t) + .1F(A(t), B(t))[1] + k(t - \floor(t))R_1(A(t), B(t)), B(t) + .1F(A(t), B(t))[2] + k(t - \floor(t))R_2(A(t), B(t)))`,color:desmosPurple,parametricDomain:{min:-100,max:100},secret:!0},{latex:String.raw`(A(t) - 10 + .1F(A(t) - 10, B(t))[1] + k(t - \floor(t))L_1(A(t) - 10, B(t)), B(t) + .1F(A(t) - 10, B(t))[2] + k(t - \floor(t))L_2(A(t) - 10, B(t)))`,color:desmosPurple,parametricDomain:{min:-100,max:100},secret:!0},{latex:String.raw`(A(t) + .1F(A(t), B(t))[1] + k(t - \floor(t))L_1(A(t), B(t)), B(t) + .1F(A(t), B(t))[2] + k(t - \floor(t))L_2(A(t), B(t)))`,color:desmosPurple,parametricDomain:{min:-100,max:100},secret:!0}]}}}),createDesmosGraphs();var t=$("#vector-field-canvas");const r=new VectorField({canvas:t});r.loadPromise.then(()=>{r.run({generatingCode:"(.23 * (x + y), .23 * (-2.0 * x + 3.0 * y))",zoomLevel:1}),r.pauseWhenOffscreen()}),showPage()}export{load};